import React from "react";

class ChannelList extends React.Component {
  render() {
    const channelLis = this.props.channels.map(channelName => <li key={channelName}>{channelName}</li>)
    return (
      <div>
        <h4>Channels</h4>
        <button>+</button>
        <ul>
          {channelLis}
        </ul>
      </div>
    );
  }
}

export default ChannelList;
